import React from 'react';
import ReactDOM from 'react-dom/client';
import "./style.css"


const root = ReactDOM.createRoot(document.getElementById('root'));

// Creating Navbar
function Navbar()
{
  return(
    <nav>
      <h1>Perfumy</h1>
      <ul>
        <li>Home |</li>
        <li> Product |</li>
        <li> About |</li>
        <li> Contact Us</li>
      </ul>
    </nav>
  )
}

// Creating Searchbox
function Searchbox()
{
  return(
    <div className="searchbar">
      <input type="text" placeholder="Search" />

    </div>
  )
}

//Creating Products
function Products()
{
  return(
    <div className="products">

    </div>
  )
} 

root.render(
  <div>
    <Navbar></Navbar>
    <Searchbox></Searchbox>
  </div>
);
